import React, {Component} from 'react';
import {
    BrowserRouter,
    Switch,
    Route,
    Link,
    useParams,
    useRouteMatch
} from "react-router-dom";


class FullPriziv extends Component {
    constructor(props) {
        super(props);
        this.state = {
            error: null,
            isLoaded: false,
            range: [],
            models: [],

        }
        this.qq=1;
        this.cc=1;

    }
    componentDidMount(){
        let combo=window.location.pathname.split('/');
        this.qq=combo[2]
        const res = fetch("http://127.0.0.1:8000/prizivniki/"+this.qq)
        .then (res => res.json())
        .then(

            (result) =>{
                this.setState({
                    isLoaded:true,
                    range: result,
                });
                // this.range=result;

            },
            (error) =>{
            this.setState({
                isLoaded:false,
                error});
            }
        )
        const res2 = fetch("http://127.0.0.1:8000/categoriya/"+this.cc)
        .then (res2 => res2.json())
        .then(

            (result) =>{
                this.setState({
                    isLoaded:true,
                    cat: result,
                });
                // this.range=result;

            },
            (error) =>{
            this.setState({
                isLoaded:false,
                error});
            }
        )
    }
    render() {
        const {error, isLoaded, range, cat} = this.state;
        if (error) {
            return <p>ERROR</p>
        } else if (!isLoaded) {
            return <p>LOADING</p>
        } else {
            return (
                <div>
                    <Link to="/priziv">Призывники</Link> / <Link to={`/${range.surname}`}>{range.surname}</Link>
                    <img src={require('./1.png')} width="240" height="255" />
                    <div className={"name"}><a>Фамилия:</a> {range.surname}</div>
                    <div className={"name"}><a>Имя:</a> {range.name}</div>
                    <div className={"name"}><a>Отчество:</a> {range.patronymic}</div>
                    <div className={"name"}><a>Категория:</a> {range.categoriya}</div>
                    <div className={"name"}><a>Возраст:</a> {range.vozrast}</div>
                    <div className={"name"}><a>Наличие отсрочки:</a> {range.otsrochka}</div>
                    <div className={"name"}><a>Адрес:</a> {range.adress}</div>
                </div>
            );
        }
    }
}

export default FullPriziv;
